import React from 'react';

export default () => {

  return (
    <div class="student">
      <img class="avatar-card" src="./1.png" alt=""/>
      <span class="avatar-points">10</span>
      <div class="card">
        <div class="card-p">
          <p class="card-name">Nombre</p>
          <p class="card-surname">Apellidos</p>
        </div>
      </div>
    </div>
);
};
